import React, { Component } from 'react';
import '../App.css';

class Contact extends Component {
    render() {
        return (
            <div>
                <div id="navbar">
                        <Link className="hvr-grow" id="logo" to="/"><p>Color.</p></Link>
                </div>
            </div>
        );
    }
}
export default Contact;
